/* eslint-disable @typescript-eslint/no-unsafe-assignment */
/* eslint-disable @typescript-eslint/restrict-template-expressions */
/* eslint-disable @typescript-eslint/no-unsafe-return */
/* eslint-disable @typescript-eslint/no-unsafe-member-access */
/* eslint-disable @typescript-eslint/no-unsafe-call */
import {
  Box,
  Button,
  Dialog,
  DialogContent,
  Grid,
  Icon,
  LinearProgress,
  makeStyles,
  MenuItem,
  Select,
  Typography,
  CircularProgress,
  Paper,
} from '@material-ui/core';
import jwtDecode from 'jwt-decode';
import React, { useEffect, useState } from 'react';
import ReactGA from 'react-ga';
import { COLORS } from '../../../plTheme';
import { _t_ } from '../../../utils/translation/translation';
import CustomizedTabs from '../../molecules/CustomisedTabs';
import Sidebar from '../Sidebar';
import Tick from '../../../assets/AdminPortal/Tick.png';

import CRM from '../../../assets/AdminPortal/CRM.jpg';
import SalesEngagement from '../../../assets/AdminPortal/SalesEngagement.jpg';
import SalesEnablement from '../../../assets/AdminPortal/SalesEnablement.jpg';
import SalesAnalytics from '../../../assets/AdminPortal/SalesAnalytics.jpg';
import HRIS from '../../../assets/AdminPortal/HRIS.jpg';
import LearningManagement from '../../../assets/AdminPortal/LearningManagement.jpg';
import ProductiveSuite from '../../../assets/AdminPortal/ProductiveSuite.jpg';
import OKR from '../../../assets/AdminPortal/OKR.jpg';
import Others from '../../../assets/AdminPortal/Others.jpg';
import { DesktopDatePicker, LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import TextField from '@mui/material/TextField';
import '../AdminDashboard/styles.css';
import dayjs, { Dayjs } from 'dayjs';
import ArrowBackButton from '@material-ui/icons/ArrowBack';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import EditIcon from '@material-ui/icons/Edit';
import { ButtonGroup } from 'semantic-ui-react';

ReactGA.pageview(window.location.pathname);

const useStyles = makeStyles(() => ({
  contentAlignment: {
    padding: '2%',
    backgroundColor: COLORS.HOMEPAGE_BACKGROUND,
    width: 'calc(100% + 57px)',
  },
  buttonStyles: {
    marginRight: '16px',
    width: '68.08px',
  },
  hideWhenPrint: {},
  [`@media print`]: {
    contentAlignment: {
      padding: 0,
    },
    hideWhenPrint: {
      display: 'none',
    },
    tabAlignment: {
      paddingLeft: '0%',
    },
  },
  tabAlignment: {
    paddingLeft: '1%',
  },
  titleDesc: {
    fontWeight: 300,
  },
  dialog: {
    position: 'absolute',
    width: 975,
    height: 470,
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    background: '#FFFFFF',
    border: '1px solid #D7DFE9',
    boxShadow: '0px 4px 20px rgba(126, 133, 142, 0.12)',
    borderRadius: 4,
  },
  dialog1: {
    position: 'absolute',
    width: 975,
    height: 362,
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    background: '#FFFFFF',
    border: '1px solid #D7DFE9',
    boxShadow: '0px 4px 20px rgba(126, 133, 142, 0.12)',
    borderRadius: 4,
  },
  mainTitle: {
    ' font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': '500',
    'font-size': '24px',
    'line-height': '32px',
    flex: 'auto',
    textAlign: 'center',
  },
  subTitle: {
    // width: '509px',
    height: '21px',
    'font-family': 'Rubik',
    'font-style': 'normal',
    'font-weight': '300',
    'font-size': '14px',
    'line-height': '21px',
    'text-align': 'center',
    color: '#171F46',
    flex: 'none',
    order: 1,
    'align-self': 'stretch',
    'flex-grow': '0',
